import {Card} from 'antd'

const {Meta} = Card;

const CardItem =({title, text, imageSrc, price}) =>(
    <Card 
    hoverable
    style = {{width:250, borderRadius:'7px', height:'450px'}}
    cover={
        <img style={{ borderRadius:'7px'}} src={imageSrc}/>
    }
    >
        <link to={`/product/`}> 
        </link>
        <Meta title ={title} description = {text}/>
        <p style={{color:"#CE4E45"}}>${price}</p>
        <button style={{width:"100px", height:"30px", borderWidth:"0", borderRadius:"3px"}}>Buy now</button>
    </Card>
);

export default CardItem;
